import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import { FaChalkboardTeacher } from "react-icons/fa";
import { HiOutlineBookOpen, HiAnnotation } from "react-icons/hi";
import StudyMaterialImg from "../img/undraw_Bookshelves_re_lxoy.svg";

const CourseContent = props => {
  return (
    <div className="md:ml-20">
      <div className="bg-blue-400 p-2 my-2 rounded-xl mx-2">
        <h1 className="text-2xl text-white m-2 px-2">
          English For Today || {props.myparam}{" "}
        </h1>
      </div>
      <div className="bg-gray-200 h-screen p-2 my-2 rounded-xl mx-2">
        <div className="bg-gray-700 text-white m-2 rounded-xl p-2">
          <h1 className="text-xl flex gap-2 ">
            {" "}
            <FaChalkboardTeacher className="text-3xl" />
            Course Teacher: <span> Fahad Faisal</span>
          </h1>
          <h1 className="text-xl flex gap-2">
            <HiOutlineBookOpen className="text-3xl" />
            Course Code: <span> ENG101</span>
          </h1>
          <h1 className="text-base flex gap-2">
            {" "}
            <HiAnnotation className="text-xl" /> Course Description:{" "}
            <span className="text-base">
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Corporis
              exercitationem itaque quae excepturi reprehenderit nisi quos
              consectetur tenetur ipsam nobis!
            </span>
          </h1>
        </div>
        <div className=" grid grid-cols-5 gap-4">
          <div className="bg-gray-200 shadow-2xl align-ceter p-4 rounded-xl">
            <img className="w-4/5 " src={StudyMaterialImg} alt="" />
          </div>
          <div className="bg-green-400 p-4 rounded">Class Recordings</div>
          <div className="bg-green-400 p-4 rounded">Exams</div>
          <div className="bg-green-400 p-4 rounded">Progress</div>
          <div className="bg-green-400 p-4 rounded">Discussion</div>
        </div>
      </div>
    </div>
  );
};

export default CourseContent;
